import React from 'react';

//Conceitos principais do React: Componente, estado, propriedade
//Componente: Bloco isolado de HTML, CSS e JS, o qual não interfere no restante da aplicação
//Propriedade:
//Estado:

function App() {
  return (
    <div>
    <Header title="Dashbord 1"/>
    <Header title="Dashbord 2"/>
    <Header title="Dashbord 3"/>
    </div>
  );
}

function Header(props)
{

  return (
      <h1>{props.title}</h1>
  );
}

export default App;
